export function add04(a: number, b: number): number {
  return a + b;
}

export function subtract04(a: number, b: number): number {
  return a - b;
}

export function multiply04(a: number, b: number): number {
  return a * b;
}

export function divide04(a: number, b: number): number {
  return a / b;
}
